import React from "react";
import styled from "styled-components";
import HeaderLinks from "./Constants";

const HeaderNavLink = styled.a.attrs({ className: "no-underline " })`
  margin-left: 20px;
  color: ${props => (props.active ? "#121212" : "hsla(0,0%,7%,.5)")};
  font-size: 16px;
  @media (min-width: 1020px) {
    font-size: 18px;
  }
`;

const Button = styled.a.attrs({ className: "" })`
  font-family: FuturaBT-Book, sans-serif;
  font-size: 18px;
  font-weight: 300;
  background: #ffb21a;
  border-radius: 52px;
  color: #fff;
  padding: 16px 20px 15px;
  text-decoration: none;
  transition: backgroun;
`;
const HeaderNav = () => (
  <nav className="lg:block md:block hidden">
    <ul className="flex justify-end">
      {HeaderLinks.map(link => (
        <li>
          <HeaderNavLink active={link.active}>{link.name}</HeaderNavLink>
        </li>
      ))}
    </ul>
  </nav>
);

export default HeaderNav;
